def color_braile2(m: re.Match):
    global ln
    char = 0
    for p in re.split("( )", m.group()):
        if p == "‚ñà" or p == " ":
            yield p
        else:
            char += 1
            yield (f"{p}", p)[char % 2]
    if not (ln := ln + 1) % 2:
        yield ""


